import React from 'react'
import AllUsers from './AllUsers'
import UserPage from './UserPage'

export default function Catalog({single,editProf}) {
  return (
    <div>
       {
      editProf
      ?
      <UserPage
      single={single}
      />
      :
      <AllUsers
      single={single}
      />
         }
    </div>
  )
}
